import React, { useState } from "react";
import styles from "./SearchResults.module.css";

const songs = [
  {
    songName: "Song1",
    songArtist: "Artist1",
    songAlbum: "Album1",
    songID: "id1",
  },
  {
    songName: "Song2",
    songArtist: "Artist2",
    songAlbum: "Album2",
    songID: "id2",
  },
  {
    songName: "Song3",
    songArtist: "Artist3",
    songAlbum: "Album3",
    songID: "id3",
  },
];

const Song = ({id,title,cover}) => 
  <li key={id}>
    <h2>{title}</h2>
    <img alt={`cover of ${title}`} src={cover} />
  </li>

export default function SearchResults() {
  return (
    <div
      className="SearchResults-header"
      style={{ border: "1px solid black", marginRight: "2em" }}
    >
      <h1>Results</h1>
      <div style={{ border: "1px solid black", marginRight: "2em" }}>
        <h2>
          Test Song Result
          {/* <ResultName /> */}
        </h2>
        <div className={styles.btntest}>
          <button>Add</button>
        </div>
      </div>
    </div>
  );
}
